import axios from "axios";
import { useEffect, useState } from "react"; //to use function to get information  and useState to store data
import { Table,Button } from "react-bootstrap";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTrashAlt } from '@fortawesome/free-solid-svg-icons';

function DoctAss() {

    const [doctors, setdoctor] = useState([]);
    var count = 1;
    useEffect(() => {
        axios.get("http://localhost:4000/doctorAss", { withCredentials: true })
            .then(res => {
                setdoctor(res.data.drassigmnent.dr);
            }).catch(err => console.log(err));
    }, [])

    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>Num</th>
                    <th>Name</th>
                    <th>Phone Number</th>
                    <th>Email</th>
                    <th>Time Booking</th>
                    <th>Delete</th>
                </tr>
            </thead>
            <tbody>
                {doctors.map((doctor) => (
                    <tr key={Math.random()}>
                        <td>{count++}</td>
                        <td>{doctor.name}</td>
                        <td>{doctor._id}</td>
                        <td>{doctor.email}</td>
                        <td>{doctor.datenow}</td>
                        <td><Button variant="danger">Delete</Button></td>
                    </tr>
                ))
                }
            </tbody>
        </Table>
    )
}

export default DoctAss;
